	function approveReject() {
		let statusValue = $('#selectStatus').val();
		if (statusValue === '1') {
			$('.nomandate').hide();
			$('.mandate').show();
		}
		else if (statusValue === '0') {
			$('.nomandate').hide();
			$('.mandate').show();
		}

		else {
			$('.nomandate').hide();
			$('.mandate').hide();
		}
	}

	function bindCommentModel(comment) {
		$('#commentArea').val(comment);
	}
